import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';

import './App.css';

function App() {
  return (
    <Container maxWidth="lg">
      <AppBar position="static" color="inherit">
        <Typography variant="h3" align="center">Personal Training Management</Typography>
      </AppBar>
      <Grow in>
        <Container>
          <Grid container jistify="space-between" alignItems="stretch">
            <Grid item={12} sm={7}>
              <Trainings />
            </Grid>
          </Grid>
        </Container>
      </Grow>
    </Container>
  );
}

export default App;
